import "./singlePost.css"

export default function SinglePost() {
  return (
    <div className="singlePost">
      <div className="singlePostWapper">
        <img src="https://cff2.earth.com/uploads/2023/04/24071439/Star-explosion3-scaled.jpg" alt="" className="singlePostImg" />
        <h1 className="singlePostTitle">Supernova</h1>
      </div>
    </div>
  )
}
